import Board from './Board';
import Entry from './Entry';

function Game() {
  let dictionary = require('./data/words_dictionary.json');

  const handleSubmit = word => {
    return word in dictionary;
  }

  return (
    <div>
      <Board />
      <Entry handleSubmit={handleSubmit}/>
    </div>
  );
}

export default Game;
